    /**
     * for the CONSTANT case,
     *
     * /1
     * |  (B - I)(dBt)
     * /0
     * ------------------
     *      /1
     * sqrt(|  ((B - I)^2)(dt))
     *      /0
     *
     * @param FT
     * @return
     */
    public double fromFiltration(Filtration FT) {
        FiltrationFunction numeratorFunction = new F_sum_BtDt() {

            @Override
            public double evaluate(int t) {
                double Bt = FT.B(t);
                return Bt - sum_BtDt;
            }
        };

        FiltrationFunction denominatorFunction = new F_sum_BtDt() {

            @Override
            public double evaluate(int t) {
                double Bt = FT.B(t);
                return pow(Bt - sum_BtDt, 2);
            }
        };

        return ADFAsymptoticDistribution.ratio(numeratorFunction, denominatorFunction, FT);
    }

    public double fromRegression(Vector y, Matrix X) {
        LMProblem problem = new LMProblem(y, X, true);
        return ADFFiniteSampleDistribution.testStat(problem);
    }
